import { useState, useEffect } from "react";
import { AiTwotoneLike } from "react-icons/ai";
import { IoMdCalendar } from "react-icons/io";
import './style.css'

const DoctorDetails = () => {
    const [doctorDetails, setDoctorDetails] = useState([]);
    
    useEffect(() => {
        const getDoctorDetails = async () => {
            const url = 'http://localhost:5000/doctors/Dentist/'
            const response = await fetch(url);
            if(response.ok === true) {
                const data = await response.json();
                const formattedData = data.map(eachItem => ({
                    id: eachItem.id,
                    doctorName: eachItem.doctor_name,
                    doctorType: eachItem.doctor_type,
                    imageUrl: eachItem.image_url,
                    yearsOfExp: eachItem.years_of_exp,
                    location: eachItem.location,
                    hospitalName: eachItem.hospital_name,
                    fees: eachItem.fees,
                    satisfaction: eachItem.satisfaction,
                    noOfPatientStories: eachItem.no_of_patient_stories,

                    
                }))
                setDoctorDetails(formattedData);
            }
        }
        getDoctorDetails();
    })

    return(
        <div className="doctor-details-con">
            <h1 className="doctor-details-heading">Dentist</h1>
            <ul className="doctor-details-list">
                <li className="doctor-details-item">
                    <img src='' alt="" className="doctor-details-image" />
                    <div className="doctor-details">
                        <div className="doctor-details-left">
                            <h1 className="doctor-details-name">Dr. Aman</h1>
                            <p className="doctor-type">Dentist</p>
                            <p className="doctor-exp">10 years experience overall</p>
                            <p className="doctor-details-loc-clinic"><span className="location">Delhi, someplace</span> • Face Mile Disinfect Clinic</p>
                            <p className="doctor-details-fee">₹500 Consultation fee at clinic</p>
                            <div className="doctor-details-rating">
                                <div className="doctor-details-rating-con">
                                    <AiTwotoneLike className="icon" />
                                    <p className="rating">99%</p>
                                </div>
                                <p className="patients">17 Patients Stories</p>
                            </div>
                        </div>
                        <div className="doctor-details-right">
                            <div className="doctor-details-avail">
                                <IoMdCalendar className="icon2" />
                                <p className="avail">Available Today</p>
                            </div>
                            <button className="book-appointment-btn">
                                Book Appointment
                                <br />
                                <span className="book-appointment-btn-span">No Booking Fee</span>
                            </button>
                        </div>
                    </div>
                </li>
            </ul>
        </div>
    )
}

export default DoctorDetails;
